    return (
        <div className={s.goal}>
            <div className={s.content}>
                <p>
                    {props.goal.name}
                </p>
                <div>
                    <button>
                        <img src={edit} alt=""/>
                    </button>
                    <button>
                        <img src={del} alt=""/>
                    </button>
                </div>
            </div>
        </div>
    );
}

export default Goal;
